import React from 'react';
import StatusBar from './StatusBar';
import QuestionList from './QuestionList';
import styled from 'styled-components';

const ActiveGame = () => {
  return (
    <>
      <StatusBar />
      <QuestionList />
    </>
  );
};

export default ActiveGame;
